for (file_name , graph_content) in graphs { let mut nodes = Vec :: new () ; let mut edges = Vec :: new () ; for line in graph_content . lines () { let line = line . trim () ; if line . is_empty () || line . starts_with ("digraph") || line . starts_with ("}") { continue ; } if line . contains ("->") { edges . push (format ! (" {}" , line)) ; } else if line . contains ("node_") && line . contains ("[") && line . contains ("]") { let mut node_line = line . to_string () ; if node_line . contains ("Condition:") { node_line = node_line . replace ("shape="oval"" , "shape="diamond"") ; } else if node_line . contains ("Loop:") { node_line = node_line . replace ("shape="oval"" , "shape="hexagon"") ; } else { node_line = node_line . replace ("shape="oval"" , "shape="box"") ; } nodes . push (format ! (" {}" , node_line)) ; } } if ! nodes . is_empty () || ! edges . is_empty () { let cluster_name = file_name . replace ('\' , "_") . replace ('/' , "_") . replace ('.' , "_") ; let display_name = file_name . replace ('\' , "/") ; merged . push_str (& format ! (" subgraph cluster_{} {{
" , cluster_name)) ; merged . push_str (& format ! (" label="{}";
" , display_name)) ; merged . push_str (" style=rounded;
") ; merged . push_str (" color=gray;
") ; merged . push_str (" bgcolor=aliceblue;
") ; merged . push_str (" fontsize=12;
") ; merged . push_str (" margin=16;
") ; merged . push_str (" node [style=filled];

") ; if ! nodes . is_empty () { merged . push_str (& nodes . join ("
")) ; merged . push_str ("
") ; } if ! edges . is_empty () { merged . push_str (& edges . join ("
")) ; merged . push_str ("
") ; } merged . push_str (" }

") ; } }
